import typing
from genetic_code import genetic_code


def translate_rna(rna: str, genetic_code: typing.Dict["str", "str"]) -> str:
    """
    Translate RNA to amino acid sequence.

    Args:
        rna: A string of RNA

    Returns:
        An amino acid sequence
    """

    codons = [rna[i : i + 3] for i in range(0, len(rna), 3)]

    return "".join(genetic_code.get(codon) for codon in codons).replace("*", "")


if __name__ == "__main__":
    print(
        translate_rna(
            "",
            genetic_code,
        )
    )
